window.bookSummaryJSON = "<p><b>Guilt-ridden, her magic waning, Constance Campbell must defeat her greatest foe yet. </b></p> <p>When the Faction shows up in Creel Creek, it may mean Constance will finally find out the truth about her mother's disappearance. But the secretive magical organization has a long history of covering up the facts. She won't get them so easily. </p> <p>When murders begin popping up all over the country with ties to the supernatural, a hunter sets his sights on the small town. He kills three shifters with his sword. </p> <p>And he's not the only thing that's putting the paranormal community in danger. The Creel Creek After Dark podcast convention has its own surprise in store. </p> <p>It's up to Constance to protect those she loves and help catch this killer. The question is, can she do both?</p>"; 
